import React from "react";
import "../DscUp/dscup.css";

const DscUp = () => {
  return (
    <div className="upload-container">
      <h1>DSC Video Verification</h1>
      <p>Please follow these steps for DSC video verification:</p>
      <ol className="verification-steps">
        <li>Record a clear video in a well-lit environment.</li>
        <li>Ensure your face and government-issued ID are clearly visible.</li>
        <li>Clearly state your full name and DSC details at the start of the video.</li>
        <li>
          After recording, please contact our support team to submit your video
          for verification.
        </li>
      </ol>
      <p>
        To sign up for DSC, please{" "}
        <a
          href="https://certificate.pantasign.com/Account/SignUp"
          target="_blank"
          rel="noopener noreferrer"
        >
          click here
        </a>.
      </p>
    </div>
  );
};

export default DscUp;
